import people from '../assets/images/Group 38.png';
import ring from "../assets/icons/ring-icon.svg";

const WaitingList = () => {
    return (
        <section className="waiting-list pt-[90px] pb-[130px] relative">
            <div className="w-full flex flex-wrap justify-between">
                <div className="w-1/2 pr-[40px] mt-auto mb-auto">
                    <h2 className="text-[32px] font-bold color-natural mb-8">Fity predstavlja spoj nutricionizma, kulinarstva i tehnologije</h2>
                    <p className="pr-32">Svi alati za planiranje, pripremu i praćenje plana ishrane su sigurni, bezbedni i zdravi.<br/><br/>Aplikacija je kreirana od strane stručnih lica, među kojima su eminentni nutricionisti, fitnes zajednica, psiholozi, IT stručnjaci i kulinarski majstori.</p>
                </div>
                <div className="w-1/2 pl-[40px] mt-auto mb-auto">
                    <img src={people} alt="people" />
                </div>
            </div>
            <div className="flex w-[350px] hero-button mt-10 justify-center mr-auto ml-auto">
                <p className="text-white pr-4 text-[18px] font-semibold">Budi među prvim korisnicima</p>
                <img src={ring} alt="ring icon" />
            </div>
        </section>
    );
};

export default WaitingList;
